// import logo from './images/revs.png';
import './customerWindowGUI.css';
import Cart from './Cart';
import Menu from './Menu';
import data from './tempData';
import Header from './Header';
import React from "react";
import DeliveryInput from './deliveryAddress';
import axios from "axios";
import {useEffect} from 'react'




function Customer() {

  //getting data from menu_items
  useEffect(()=>{
    axios.get("http://localhost:3300/menu_items").then((response)=>{
      console.log(response)
    })
  }, [])


  const {items} = data;
  return (
    <div className="Customer Customer-header">
        <Header></Header>
        <div className="row">
          <Menu items={items}></Menu>
          <div className="Customer Customer-header">
            <Cart></Cart>
            <DeliveryInput></DeliveryInput>
          </div>

        </div>
    </div>

  );
}

export default Customer;
